import "./products.css";
function Product() {
  return (
   <div className=""> 
    <h1>Products</h1>
     <div className="products">
      <ProductItem></ProductItem>
      <ProductItem></ProductItem>
      <ProductItem></ProductItem>
      <ProductItem></ProductItem>
    </div>
   </div>
  );
}

export default Product ;
